import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { RegisterComponent } from './pages/register/register.component';
import { LoginComponent } from './pages/login/login.component';
import { HttpClientModule } from '@angular/common/http';
import { UserDashboardComponent } from './pages/user-dashboard/user-dashboard.component';
import { AdminDashboardComponent } from './pages/admin-dashboard/admin-dashboard.component';
import { AddTripComponent } from './pages/add-trip/add-trip.component';
import { TripListComponent } from './components/trip-list/trip-list.component'; // ✅ Import this

@NgModule({
  declarations: [
    AppComponent,
    RegisterComponent,
    LoginComponent,
    UserDashboardComponent,
    AdminDashboardComponent,
    AddTripComponent,
    TripListComponent // ✅ Add to declarations
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule
    // ❌ Don't add CommonModule here, it's already part of BrowserModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
